/**
 * 页面名_模块名_类型名
 */
const comState = {
    labelPage: (data) => {
        console.log(data, 'pagepage');
        return {
            default: 0,
            type: 'handleLabelPage',
            data: {
                labelPage: Number(data.labelPage)
            }
        }
    }
}

export default comState;
